class TimePureHDF5:
    def time_getattr(self):
        dataset = self.file['data']
        dataset[:, 0, 0:6]

    def setup(self):
        self.file = h5py.File('bench.hdf5', 'w')
        self.file.create_dataset('data',
                                 data=np.arange(10000).reshape((100, 10, 10)),
                                 chunks=(3, 3, 3), maxshape=(None, None, None))

